    print("Recording...")
    with sc.default_microphone().recorder(samplerate=SAMPLE_RATE) as mic:
        mic_data = mic.record(numframes=TOTAL_SAMPLES).T[0]
        # mic_data_transposed = mic_data.T
        # mic_data_transposed_one_channel = mic_data_transposed[0]
