        # mic_data[i, 1] = mic_data[i, 0]
        # print("after: " + str(mic_data[i]))
    print("DONE!\nSearching...")
    id = get_excerpt_id(mic_data)
    print("SEARCH COMPLETE!\nBUFFER ID: " + str(id))

